  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Medical device manufacturers are required
  to submit a premarket notification or 510(k) if they intend to introduce a device
  into commercial distribution for the first time or reintroduce a device that will
  be significantly changed or modified to the extent that its safety or effectiveness
  could be affected. This database of releasable 510(k)s can be searched by 510(k)
  number, applicant, device name or FDA product code. Summaries of safety and effectiveness
  information is available via the web interface for more recent records.</p>n\",\n\t\"license_title\":
